import ItemTile from './itemTile.js'
import './store.css';
import image from '../../images/IMG-3157.png';

export default function Shop() {

  const items = [
      { 'image': image, 'text': 'Orange Hoddy', 'price': '£35' },
      { 'image': image, 'text': 'Purple Hoody', 'price': '£35' },
      { 'image': image, 'text': 'Black Hoody', 'price': '£35' },
      { 'image': image, 'text': 'Orange Hoddy', 'price': '£35' },
      { 'image': image, 'text': 'Purple Hoody', 'price': '£35' },
    ]

   return (
    <div className="container">
        { 
          items.map( 
            item => (<ItemTile image={item.image} 
                               text={item.text}
                               price={item.price} />)
          )
        }
    </div>
  );
}
